#!/usr/bin/env ruby

# abstract
#   mksrc4fixed.rb:
#   create a src for malconv.rb to output a fixed ascii text
#   ( from stdin or a file )
#
# details
#   the main strategy is to place "one-off" instructions/data.
#   assume D=2820 (=0 mod 94), data "?NI" placed at address 2820
#   create 29505 ( 65 in mod 256, printed as "A" ) with code "GCC".
#   this tool places appropriate instructions/data code corresponding to
#   the input text repeatedly from C=48, D=2197.
#   given the text is "ABC" for example;
#    1. D=2197 (=35 mod 94)
#      select "RCC" for instructions and "NIC" to create a value =65 in mod 256.
#      and place "RCCP" from address 48, "NIC?" from address 2197.
#    2. D=2201 (=39 mod 94)
#      select "RCC" for instructions and "CDI" to create a value =66 in mod 256.
#      and place "RCCP" from address 52, "CDI?" from address 2201.
#    3. D=2205 (=43 mod 94)
#      select "NGC" for instructions and "??I" to create a value =67 in mod 256.
#      and place "NGCP" from address 56, "??I?" from address 2205.
#
#    the instrctions/data pattern database, created with misc/search-op-pattern.rb,
#    is placed at the end of this tool. ( after __END__ line )
#
#    the code pattern shown in SRC_H, SRC_S are a template to set C=48,D=2197 environment.
#
SLICE_SIZE = 16
SRC_H = 'N*6 DRDN DRDN DRDN DD N>25 I ?>35 GE ?>47 E'
SRC_S = '?>2196 E'
CODEDB = DATA.map{|line|
  t = line.chomp.split(/, |:/)
  96.times.map{|i| t[i*3+2,2] }
}
ifile = ARGV[0] || '(stdin)'
oplines = []
dlines = []

pos = 2197 % 94
$<.read.each_char.chunk(&:itself).each_slice(SLICE_SIZE){|s|
  icomment = '#'
  dcomment = '#'
  istr = ''
  dstr = ''
  s.each{|c,r|
    len = r.size
    icomment += ?\s + c.inspect + ( len>1 ? "x#{len}" : '' )
    code = c.ord
    if code==10
      j = 0
    elsif (32..126)===code
      j = c.ord - 31
    else
      raise "unsupported char #{c.inspect} found"
    end
    dcomment += " #{pos},#{code}"
    itok, dtok = CODEDB[pos][j]
    istr += " #{itok}#{?P * len}"
    dstr += " #{dtok}#{?? * len}"
    pos = (pos+itok.size+len) % 94
  }
  oplines.push(icomment)
  oplines.push(istr)
  dlines.push(dcomment)
  dlines.push(dstr)
}

puts "# auto generated malbolge src with mksrc4fixed.rb for #{ifile}"
puts SRC_H, oplines, SRC_S, dlines

__END__
